import { useState, useCallback, Dispatch, useEffect } from "react";


import {
  TextField,
  FormControl,
  InputLabel,
  MenuItem,
  FormHelperText,
  Select,
  Button,
  Icon,
  FormControlLabel,
  RadioGroup,
  Radio,

} from "@mui/material";
import moment from "moment";
import HIPAAComplianceContainer from "./../../../components/HIPAAComplianceContainer";
import "./AdmitPatientupdated.css";
import React from "react";
import { connect } from "react-redux";
import { DatePicker, LocalizationProvider, MobileDateTimePicker } from "@mui/x-date-pickers";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";
import bottomImage from './../../../assets/images/mettler_images/bg.svg';
import newImage from './../../../assets/images/mettler_images/rectangle-5999.svg';
import PatientVisitData from './../../../assets/data/PatientVisitData.json'
import { createptvisit, getptvisit, Updateptvisit } from "../../../store/actions/PatientVisitAdminController";
import * as Constants from "./../Constants/ConstantValues";
import SecondaryButton from "../../../components/SecondaryButton";
import PrimaryButton from "../../../components/PrimaryButton";
import "../../../components/BottomFooter.css";
import { HttpLogin } from "../../../utils/Http";
import { getAllPatient } from "../../../store/actions/Patient";
import { getAllStaff } from "../../../store/actions/Staff";
import AvatarBigImage from './../../../assets/images/mettler_images/AvatarBigImage.png';
import bloodBag from './../../../assets/images/mettler_images/blood_bag.svg';
import bloodDrop from './../../../assets/images/mettler_images/blood_drop.svg';
import bloodDropNew from './../../../assets/images/mettler_images/blood_dropNew.svg';
import bloodDropNewOne from './../../../assets/images/mettler_images/blood_dropNewOne.svg';
import AvatarDoctorImage from './../../../assets/images/mettler_images/AvatarDoctor.png';
import { createBrowserHistory } from "history";

interface IAdmitPatientupdated { }
interface IAdmitPatientupdated {
  StaticPage: any;
  dispatch: Dispatch<any>;
  getbyidptvisitData: any;
  CreateptvisitData: any;
  updateptvisitData: any;
  getAllPatientData: any;
  errorMessage: any;
  getAllStaffData: any;
  match: any;
  state: {
    nodes: [],
    checked: [],
    expanded: []
  }
}
const AdmitPatientupdated: React.FC<IAdmitPatientupdated> = ({
  dispatch, getbyidptvisitData, errorMessage, match, CreateptvisitData, updateptvisitData, getAllPatientData, getAllStaffData


}) => {

  const history = createBrowserHistory();
  let [inputFormData, setInputFormData] = useState(PatientVisitData);
  let [getPatientDataItems, setGetPatientDataItems] = useState(new Array<any>());
  let [getStaffDataItems, setGetStaffDataItems] = useState(new Array<any>());
  let [displayLocationData, setDisplayLocationData] = useState(new Array<any>());
  let [encryptPatientId, setEncryptPatientId] = useState(null);
  let [decryptPatientId, setDecryptPatientId] = useState(null);
  let [encryptVisitId, setEncryptVisitId] = useState(null);
  let [decryptVisitId, setDecryptVisitId] = useState(null);
  let [inputOrgData, setInputOrgData] = useState("");
  let [selectedPatientName, setSelectedPatientName] = useState("");
  let [patientSSN, setPatientSSN] = useState(null);
  let [patientGender, setPatientGender] = useState(null);
  let [patientDateOfBirth, setPatientDateOfBirth] = useState(null);
  let [inputPatientInfo, setInputPatientInfo] = useState(null);
  let [patientAge, setPatientAge] = useState(null);

  useEffect(() => {
    var orgData = JSON.parse(window.localStorage.getItem("LOGINDATA"));
    orgData = orgData.loginInput.organization;
    HttpLogin.axios().get("api/org/getById/" + orgData)
      .then((res) => {
        if (res.data.message.code === "MHC - 0200") {
          setInputOrgData(res.data.data.organizationdetails[0].name);

        } else {
          setInputOrgData("");
        }
      })
    var CryptoJS = require("crypto-js");
    var encryptPatient = match.params.patientId;
    setEncryptPatientId(encryptPatient);
    let decodePatientid = decodeURIComponent(encryptPatient);
    let decodeFinalPatientid = CryptoJS.AES.decrypt(decodePatientid.toString(), 'secret key 123').toString(CryptoJS.enc.Utf8);
    setDecryptPatientId(decodeFinalPatientid);
    //  console.log(JSON.stringify(decodeFinalPatientid));
    var encryptInitial = match.params.id;
    setEncryptVisitId(encryptInitial);
    let decodeVisitid = decodeURIComponent(encryptInitial);
    let decodeFinalVisitid = CryptoJS.AES.decrypt(decodeVisitid.toString(), 'secret key 123').toString(CryptoJS.enc.Utf8);
    setDecryptVisitId(decodeFinalVisitid);
    if (decodeFinalVisitid != "") {
      //  console.log(JSON.stringify(decodeFinalVisitid));
      dispatch(getptvisit(decodeFinalVisitid));
    }
    HttpLogin.axios().get("api/patient/getPatient/" + decodeFinalPatientid)
      .then((response) => {
        //     console.log(JSON.stringify(response.data.data))     
        setSelectedPatientName(response.data.data.basicDetails[0].name[0].given);
        if (response.data.message.code === "MHC - 0200") {
          setInputPatientInfo(response.data.data.basicDetails[0].name[0].given);
          setPatientDateOfBirth(moment(response.data.data.basicDetails[0].birthDate).format('MMM DD,YYYY'));
          var genderChanges = response.data.data.basicDetails[0].gender === "M" ? "Male" : response.data.data.basicDetails[0].gender === "fm" ? "Female" : "Not Specify";
          setPatientGender(genderChanges);
          var ssnValue = response.data.data.basicDetails[0].ssn != undefined ? response.data.data.basicDetails[0].ssn.slice(6, 9) : ""
          setPatientSSN(ssnValue);
          var today = new Date();
          var birthDate = new Date(response.data.data.basicDetails[0].birthDate);
          // create a date object directly from `dob1` argument
          var age_now = today.getFullYear() - birthDate.getFullYear();
          var m = today.getMonth() - birthDate.getMonth();
          if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
            age_now--;
          }
          setPatientAge(age_now);
        } else {
          alert(response.data.message.description);
        }

      })
    HttpLogin.axios().get("api/q15form/get/wg2rzH0Yjj")
      .then((newInData) => {
        if (newInData.data.message.code === "MHC - 0200") {
          let newOutData = newInData.data.data.location;
          let entries = Object.entries(newOutData).map(([key, value]) => ({
            label: `${value}`,
            value: `${key}`
          }));
          setDisplayLocationData(entries)
        } else {
          alert(newInData.data.message.description);
        }
      })
    dispatch(getAllStaff());
    dispatch(getAllPatient());
  }, []);

  const handleInputChange = (event: any) => {
    if (event.target.name === "admittingPhysycian") {
      inputFormData.visit[0].admit[0].admittech[0].admittingPhysician[0] = event.target.value;
    } else if (event.target.name === "refferingPhysycian") {
      inputFormData.visit[0].admit[0].admittech[0].referringPhysician[0] = event.target.value;
    } else if (event.target.name === "admittingNurse") {
      inputFormData.visit[0].admit[0].admittech[0].admittingNurse[0] = event.target.value;
    } else if (event.target.name === "speciality") {
      inputFormData.visit[0].admit[0].admittech[0].speciality[0] = event.target.value;
    } else if (event.target.name === "admissionType") {
      inputFormData.visit[0].admit[0].admittech[0].admissionType[0] = event.target.value;
    } else if (event.target.name === "admissionSource") {
      inputFormData.visit[0].admit[0].admittech[0].admissionSource[0] = event.target.value;
    } else if (event.target.name === "PatientLocationorWard") {
      inputFormData.visit[0].admit[0].patientLocation[0] = event.target.value;
    } else if (event.target.id === "patientRoom") {
      inputFormData.visit[0].admit[0].patientRoom = event.target.value;
    } else if (event.target.name === "admissionReason") {
      inputFormData.visit[0].admit[0].admittech[0].admissionReason[0] = event.target.value;
    } else if (event.target.name === "visitorAdmitType") {
      inputFormData.visit[0].visitoradmitType[0] = event.target.value;
    } else if (event.target.name === "status") {
      inputFormData.visit[0].preadmit[0].astatus = event.target.value;
    } else if (event.target.id === "altPatientId") {
      inputFormData.visit[0].admit[0].altPatientID = event.target.value;
    }

    setInputFormData({ ...inputFormData });
  }

  const [isPatientPageLoaded, setPatientPageLoaded] = useState(false);

  if (!isPatientPageLoaded && !getAllPatientData.isLoading) {
    if (getAllPatientData.items.message.code === "MHC - 0200") {
      setGetPatientDataItems(getAllPatientData.items.data.filter(t => t.organization === inputOrgData));
    } else {
      setGetPatientDataItems([]);
      alert(getAllPatientData.items.message.description);
    }
    setPatientPageLoaded(true);
  }
  if (!getAllPatientData && getAllPatientData.isFormSubmit) {

    setTimeout(() => {
      setPatientPageLoaded(false);

    }, (1000));
  }

  const [isStaffPageLoaded, setStaffPageLoaded] = useState(false);

  if (!isStaffPageLoaded && !getAllStaffData.isLoading) {
    if (getAllStaffData.items.message.code === "MHC - 0200") {
      setGetStaffDataItems(getAllStaffData.items.data.filter(t => t.organization === inputOrgData));
      //  console.log(JSON.stringify(getAllStaffData.items.data));
    } else {
      setGetStaffDataItems([]);
      alert(getAllStaffData.items.message.description);
    }
    setStaffPageLoaded(true)
  }
  if (!getAllStaffData && getAllStaffData.isFormSubmit) {

    setTimeout(() => {
      setStaffPageLoaded(false);

    }, (1000));
  }

  const [isPageLoaded, setPageLoaded] = useState(false);

  if (!isPageLoaded && !getbyidptvisitData.isLoading) {
    //  console.log(JSON.stringify(getbyidptvisitData.items));
    if (getbyidptvisitData.items.message.code === "MHC - 0200") {
      getbyidptvisitData.items.data.visit[0].visitStartDate = getbyidptvisitData.items.data.visit[0].visitStartDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].visitStartDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.027Z")) : null;
      getbyidptvisitData.items.data.visit[0].visitEndDate = getbyidptvisitData.items.data.visit[0].visitEndDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].visitEndDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.145Z")) : null;
      getbyidptvisitData.items.data.visit[0].activityStartDate = getbyidptvisitData.items.data.visit[0].activityStartDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].activityStartDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.027Z")) : null;
      getbyidptvisitData.items.data.visit[0].activityEndDate = getbyidptvisitData.items.data.visit[0].activityEndDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].activityEndDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.076Z")) : null;
      getbyidptvisitData.items.data.visit[0].preadmit[0].expectedarrivalDateTime = getbyidptvisitData.items.data.visit[0].preadmit[0].expectedarrivalDateTime != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].preadmit[0].expectedarrivalDateTime, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.127Z")) : null;
      getbyidptvisitData.items.data.visit[0].preadmit[0].expecteddischDateTime = getbyidptvisitData.items.data.visit[0].preadmit[0].expecteddischDateTime != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].preadmit[0].expecteddischDateTime, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.243Z")) : null;
      getbyidptvisitData.items.data.visit[0].admit[0].admitDate = getbyidptvisitData.items.data.visit[0].admit[0].admitDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].admit[0].admitDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.199Z")) : null;
      getbyidptvisitData.items.data.visit[0].admit[0].dischDate = getbyidptvisitData.items.data.visit[0].admit[0].dischDate != null ? new Date(moment(getbyidptvisitData.items.data.visit[0].admit[0].dischDate, "YYYYMMDDHHmm").format("YYYY-MM-DDTHH:mm:ss.324Z")) : null;
      getbyidptvisitData.items.data.visit[0].admit[0].patientLocation = getbyidptvisitData.items.data.visit[0].admit[0].patientLocation !== null && getbyidptvisitData.items.data.visit[0].admit[0].patientLocation !== undefined ? getbyidptvisitData.items.data.visit[0].admit[0].patientLocation : [''];
      setInputFormData(getbyidptvisitData.items.data);
      setPageLoaded(true)
    } else {
      setInputFormData({ ...PatientVisitData });
      setPageLoaded(true);
    }




  }
  if (!getbyidptvisitData && getbyidptvisitData.isFormSubmit) {

    setTimeout(() => {
      setPageLoaded(false);

    }, (1000));
  }



  const handleClickChange = () => {
    // checkValidation();
    //  strToDateField();
    inputFormData.patientid = decryptPatientId;
    inputFormData.visit[0].visitStartDate = (inputFormData.visit[0].visitStartDate !== null && inputFormData.visit[0].visitStartDate !== "") ? moment(inputFormData.visit[0].visitStartDate).format('YYYYMMDDHHmm') : "";
    inputFormData.visit[0].visitEndDate = (inputFormData.visit[0].visitEndDate !== null && inputFormData.visit[0].visitEndDate !== "") ? moment(inputFormData.visit[0].visitEndDate).format('YYYYMMDDHHmm') : "";    
    inputFormData.visit[0].preadmit[0].expectedarrivalDateTime = (inputFormData.visit[0].preadmit[0].expectedarrivalDateTime !== null && inputFormData.visit[0].preadmit[0].expectedarrivalDateTime !== "") ? moment(inputFormData.visit[0].preadmit[0].expectedarrivalDateTime).format('YYYYMMDDHHmm') : "";
    inputFormData.visit[0].preadmit[0].expecteddischDateTime = (inputFormData.visit[0].preadmit[0].expecteddischDateTime !== null && inputFormData.visit[0].preadmit[0].expecteddischDateTime !== "") ? moment(inputFormData.visit[0].preadmit[0].expecteddischDateTime).format('YYYYMMDDHHmm') : "";    
    //  console.log(JSON.stringify(inputFormData));
    setInputFormData({ ...inputFormData });
    if (inputFormData.visit[0].visitStartDate === null || inputFormData.visit[0].visitStartDate === "" || inputFormData.visit[0].visitEndDate === null || inputFormData.visit[0].visitEndDate === "" ||
      inputFormData.visit[0].preadmit[0].expectedarrivalDateTime === null || inputFormData.visit[0].preadmit[0].expectedarrivalDateTime === "" || inputFormData.visit[0].preadmit[0].expecteddischDateTime === null || inputFormData.visit[0].preadmit[0].expecteddischDateTime[0] === "") {
      alert("Please Enter required data");
    } else if (inputFormData.id != "") {
      inputFormData.id = decryptVisitId;
      dispatch(Updateptvisit(inputFormData));
      alert("Patient admit/visit Updated");
      setTimeout(() => {       
        window.location.reload();
     }, 3000);
    } else {
      dispatch(createptvisit(inputFormData));
      alert("Patient admit/visit Created");
      setTimeout(() => {       
        history.goBack();
     }, 3000);
    }


  }


  return (


    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <>
        <div style={{ top: "6px", background: decryptPatientId != "" ? '#2D56AD' : "#FFF", height: decryptPatientId != "" ? '98px' : '0px', display: 'flex', width: 'calc(100% - 0px)', position: 'absolute', left: "0px" }} >
          <div id="mettlerEmptyPadding" className="p-col-12 p-md-1">

            <div id="mettlerEmptyPadding" className="p-col-12 p-md-1">
              <img style={{ width: '60px', height: '60px', position: 'relative', left: '13px', top: '23px' }} src={AvatarBigImage}></img>
            </div>
            <div id="mettlerEmptyPadding" style={{ display: 'flex', flexDirection: 'column' }} className="p-col-12 p-md-6">
              <div style={{ display: 'flex', flexDirection: 'row', position: "absolute", top: "7px", left: "97px" }}>
                <div style={{ position: 'relative', top: '19px', minWidth: 'max-content', fontSize: '18px' }} className="App-TopBar-PatientName">{inputPatientInfo}</div>
                <div style={{ position: 'relative', top: '23px', left: '6px', minWidth: 'max-content', fontSize: '14px' }} className="App-TopBar-PatientAge">{patientAge}Years</div>

                <div className="admit-patient-ss" style={{ width: '105px', height: '24px', background: '#5574B7', border: '1px solid #5574B7', position: 'relative', top: '19px', left: '23px' }}>
                  <div style={{ fontWeight: 400, fontSize: '12px', opacity: 0.6, color: '#FFF' }} className="admit-patient-profileName">SS#:</div>
                  <div style={{ fontWeight: 400, fontSize: '12px', color: '#FFF' }} className="admit-patient-profileName">SS-</div>
                </div>
                <div className="admit-patient-ss" style={{ width: '110px', height: '24px', position: 'relative', left: '40px', top: '19px', background: '#5574B7', border: '1px solid #5574B7' }}>
                  <div style={{ fontWeight: 400, fontSize: '12px', opacity: 0.6, color: '#FFF' }} className="admit-patient-profileName">MR:</div>
                  <div style={{ fontWeight: 400, fontSize: '12px', color: '#FFF' }} className="admit-patient-profileName">MR-345</div>
                </div>
              </div>
              <div style={{ display: 'flex', flexDirection: 'row', position: "absolute", top: "20px", left: "86px" }}>
                <div style={{ position: 'relative', top: '32px', display: 'flex' }} >
                  <img style={{ width: '26px', height: '26px', position: 'relative', top: '8px', left: '5px', fontSize: '10px' }} src={bloodBag}></img>
                  <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '7px', top: '1px', fontSize: '10px' }} className="App-TopBar-BloodName">Blood</span>
                  <span style={{ position: 'relative', top: '14px', left: '-22px', fontSize: '12px' }} className="App-TopBar-PatientValue">A</span><span style={{ position: 'relative', top: '13px', left: '-22px', fontSize: '12px' }} className="App-TopBar-PatientValue">+</span>
                </div>
                <div style={{ position: 'relative', top: '30px', left: '', display: 'flex' }}>
                  <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px', fontSize: '10px' }} src={bloodDrop}></img>
                  <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '6px', top: '5px', fontSize: '10px' }} className="App-TopBar-BloodName">Height</span>
                  <span style={{ position: 'relative', top: '18px', left: '-25px', fontSize: '12px', width: '30px' }} className="App-TopBar-PatientValue">--</span>
                </div>
                <div style={{ position: 'relative', top: '30px', display: 'flex' }}>
                  <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={bloodDropNew}></img>
                  <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '6px', top: '8px', fontSize: '10px' }} className="App-TopBar-BloodName">Weight</span>
                  <span style={{ position: 'relative', top: '23px', left: '-29px', fontSize: '12px' }} className="App-TopBar-PatientValue">45kg</span>
                </div>
                <div style={{ position: 'relative', top: '30px', display: 'flex' }} >
                  <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={bloodDropNewOne}></img>
                  <span style={{ opacity: 0.6000000238418579, position: 'relative', left: '7px', top: '9px', fontSize: '10px' }} className="App-TopBar-BloodName">DOB</span>
                  <span style={{ position: 'relative', top: '22px', left: '-13px', fontSize: '12px', width: '75px' }} className="App-TopBar-PatientValue">{patientDateOfBirth}</span>
                </div>
                <div style={{ position: 'relative', top: '30px', left: '10px', display: 'flex' }}>
                  <img style={{ width: '26px', height: '26px', position: 'relative', top: '10px', left: '5px' }} src={AvatarDoctorImage}></img>
                  <span style={{ fontSize: '16px', position: 'relative', top: '11px', left: '13px', width: '200px' }} className="App-TopBar-PatientValue">Dr. Linda Blair, OP</span>
                </div>
              </div>
            </div>

          </div>
          <div id="mettlerEmptyPadding" className="p-col-12 p-md-5">  </div>
        </div>
        <div className="AdmitPatientupdated-details" style={{ height: "1178px" }}>
          <div className="AdmitPatientupdated-details-child" />
          <div className="AdmitPatientupdated-details-child1" />
          <div className="AdmitPatientupdatedline-div" />
          <div className="AdmitPatientupdatedexpand-more-24px-parent" >
            <img
              className="AdmitPatientupdatedexpand-more-24px-icon"
              alt=""
              src="/expand-more-24px.svg"
            />
            <div style={{ minWidth: 'max-content' }} className="AdmitPatientupdateddetails">Add a Visit</div>
          </div>
         
          
          <div className="AdmitPatientupdatedorgForm-fields2">

            <MobileDateTimePicker
              label="Expected admit Date Time"
              value={inputFormData.visit[0].preadmit[0].expectedarrivalDateTime}
              onChange={(newValue) => {
                inputFormData.visit[0].preadmit[0].expectedarrivalDateTime = newValue
                setInputFormData({ ...inputFormData });
              }}
              slotProps={{
                textField: {
                  variant: "outlined",
                  size: "medium",
                  fullWidth: true,
                  color: "primary",
                },
              }}
            />
            <MobileDateTimePicker
              label="Expected discharge Date Time"
              value={inputFormData.visit[0].preadmit[0].expecteddischDateTime}
              onChange={(newValue) => {
                inputFormData.visit[0].preadmit[0].expecteddischDateTime = newValue
                setInputFormData({ ...inputFormData });
              }}
              slotProps={{
                textField: {
                  variant: "outlined",
                  size: "medium",
                  fullWidth: true,
                  color: "primary",
                },
              }}
            />

          </div>
          <div className="AdmitPatientupdatedorgForm-fields3" style={{ top: "279px" }}>
            <FormControl className="AdmitPatientupdatedname-input13" variant="outlined">
              <InputLabel color="primary">Visit Reason</InputLabel>
              <Select
                value={inputFormData.visit[0].admit[0].admittech[0].admissionReason[0]}
                color="primary"
                size="medium"
                label="Visit Reason"
                name="admissionReason" id="admissionReason" onChange={handleInputChange}>
                 <MenuItem value="Reason1">Reason 1</MenuItem>
                 <MenuItem value="Reason2">Reason 2</MenuItem>
                 <MenuItem value="Reason3">Reason 3</MenuItem>
                 <MenuItem value="Reason4">Reason 4</MenuItem>
                 <MenuItem value="Reason5">Reason 5</MenuItem>
              </Select>
              <FormHelperText />
            </FormControl>
            <FormControl className="AdmitPatientupdatedname-input13" variant="outlined">
              <InputLabel color="primary">Visit Type</InputLabel>
              <Select
                value={inputFormData.visit[0].admit[0].admittech[0].referringPhysician[0]}
                color="primary"
                size="medium"
                label="Visit Type"
                name="refferingPhysycian" id="refferingPhysycian" onChange={handleInputChange}>
                {getStaffDataItems.filter(i => i.role === "Physician Assistant").map((newData, i) => {
                  return (
                    <MenuItem key={i} value={newData.id}>{newData.name[0].given}</MenuItem>
                  )
                })}
              </Select>
              <FormHelperText />
            </FormControl>

          </div>
          <div className="AdmitPatientupdatedorgForm-fields4" style={{ top: "518px", flexDirection: "row-reverse" }}>
            <FormControl className="AdmitPatientupdatedname-input13" variant="outlined">
              <InputLabel color="primary">Reffering Physycian </InputLabel>
              <Select
                value={inputFormData.visit[0].admit[0].admittech[0].admittingNurse[0]}

                color="primary"
                size="medium"
                label="Admitting Nurse"
                name="admittingNurse" onChange={handleInputChange}>
                {getStaffDataItems.filter(i => i.role === "Registered Nurses").map((newData, i) => {
                  return (
                    <MenuItem key={i} value={newData.id}>{newData.name[0].given}</MenuItem>
                  )
                })}
              </Select>
              <FormHelperText />
            </FormControl>
            <FormControl className="AdmitPatientupdatedname-input13" variant="outlined">
              <InputLabel color="primary">Speciality</InputLabel>
              <Select

                id="speciality"
                color="primary"
                size="medium"
                label="Speciality "
                name="speciality" value={inputFormData.visit[0].admit[0].admittech[0].speciality[0]} onChange={handleInputChange}>
                <MenuItem value="Speciality1">Speciality1</MenuItem>
                <MenuItem value="Speciality2">Speciality2</MenuItem>
                <MenuItem value="Speciality3">Speciality3</MenuItem>
                <MenuItem value="Speciality4">Speciality4</MenuItem>
                <MenuItem value="Speciality5">Speciality5</MenuItem>
              </Select>
              <FormHelperText />
            </FormControl>
          </div>         
          <div className="AdmitPatientupdatedorgForm-fields8">

            <MobileDateTimePicker

              label="Visit Start Date & Time"
              value={inputFormData.visit[0].visitStartDate}
              onChange={(newValue) => {
                inputFormData.visit[0].visitStartDate = newValue
                setInputFormData({ ...inputFormData });
              }}
              slotProps={{
                textField: {
                  variant: "outlined",
                  size: "medium",
                  fullWidth: true,
                  color: "primary",
                },
              }}
            />
            <MobileDateTimePicker
              label="Visit End Date & Time"
              value={inputFormData.visit[0].visitEndDate}
              onChange={(newValue) => {
                inputFormData.visit[0].visitEndDate = newValue
